import React from "react";
import { Outlet } from "react-router-dom";
import { Header } from "../components/Header";

const PrivateRouter = () => {
  return (
    <div>
        <Header />
        <h1 className="text-3xl text-gray-750 font-semibold my-5 mx-5">POPULAR</h1>
        <br></br>
        <br></br>
        <Outlet />
    </div>
  );
}

export default PrivateRouter;
